import { Tabs, Tab } from "@mui/material";
import HomeIcon from '@mui/icons-material/Home';


const Navbar = () => {
    return (
        <div>
            <Tabs>
                <Tab label={"Home"} iconPosition={"end"} icon={ <HomeIcon /> } sx={{ 
                    color: '#ffffff', 
                    fontFamily: 'Outfit',
                    textTransform: 'none'
                }} />
                <Tab label={"Projects"} iconPosition={"end"} icon={ <HomeIcon /> } sx={{ 
                    color: '#ffffff', 
                    fontFamily: 'Outfit',
                    textTransform: 'none'
                }} />
            </Tabs>
        </div>
    )
}

export default Navbar;
